/*:
 # 第一个只出现一次的字符

 在字符串 s 中找出第一个只出现一次的字符。如果没有，返回一个单空格。

 ## 示例

 ```
 s = "abaccdeff"
 返回 "b"

 s = ""
 返回 " "
 ```

 ## 限制

 `0 <= s 的长度 <= 50000`

 ## Official Link

 <https://leetcode-cn.com/problems/reverse-integer>

 ---
 */

import Foundation

class Solution {
    func firstUniqChar(_ s: String) -> Character {
        var dict: [Character: Int] = [:]

        for i in s {
            if dict.keys.contains(i) {
                dict[i]! += 1
            } else {
                dict[i] = 1
            }
        }

        for i in s {
            if dict[i] == 1 {
                return i
            }
        }

        return Character(" ")
    }
}

var s1 = "abaccdeff"
var s2 = "cc"
var s3 = ""



Solution().firstUniqChar(s1)
Solution().firstUniqChar(s2)
Solution().firstUniqChar(s3)
